import { Link  } from '@reach/router'
import styles from '../css modules/Header.module.css'
import home from '../home-icon.png'


const Header = () => {
  return (
    <header>
      <Link to="/" className="{home-button"><img src={home} alt="Home"/></Link>
      <h1 className="page-title">northcoders news</h1>
    </header>
  );
};

export default Header;
